import logo from './logo.svg';
import './App.css';
import NavBar from "./components/NavBar";

function App() {
  return (
    <BrowserRouter>
    <NavBar />
      <Routes>
        <Route path="/" element={<TodoApp />}   />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
